import React from "react";

function Note(props) {

  function isClicked() {
    {props.toDelete(props.id);}
  }

  function deleteBtn() {
    {props.toDelete(props.id);}
  }

  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <button className="deleteBtn" onClick={isClicked}>DELETE</button>
    </div>
  );
}

export default Note;
